import React from 'react';
import AddNewSections from './components/AddNewSections';
import PropsFromChildToParent from './components/PropsFromChildToParent';


function App() {
  return (
    // use fragments tags 
    <>
    {/* Add New sections  */}
      <AddNewSections/>

    {/* App is parent and PropsFromChildToParent is child so pass props from child to parent */}

    <PropsFromChildToParent/>

    </>
  );
}

export default App;
